standardised = False #standardised Sanger or unstandardised
no_folds = 5

iterations = 1000
burnin = 800
thinning = 5

init_UV = 'random'
I, J, K = 622,139,10

alpha, beta = 1., 1.
lambdaU = numpy.ones((I,K))/10.
lambdaV = numpy.ones((J,K))/10.
priors = { 'alpha':alpha, 'beta':beta, 'lambdaU':lambdaU, 'lambdaV':lambdaV }

